import React from 'react'
import { Container, Row, Col, Button } from 'react-bootstrap';



function Home() {
  return (
    <div className="container">
    <header className="header">
        <h1>MIRESEVINI NE SPITALIN E QYTETIT</h1>
    </header>
        <p className="section-content">
            Spitali ynë ofron kujdes të shkëlqyer shëndetësor dhe përkujdesje të
            pacientëve. Jemi angazhuar për shëndetin tuaj dhe mirëqenien tuaj.
        </p>

</div>
);
}

export default Home
